import './App.css';
import {Routes, Route} from "react-router-dom";
import Login from './components/login';
import Dashboard from './components/dashboard'; 

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" component={Login} />
        <Route path="/dashboard" component={Dashboard} />
      </Routes>
    </div>
  );
}

export default App;
